    const user = interaction.options.getUser('user');
    const reason = interaction.options.getString('reason') || 'No reason provided';
    const days = interaction.options.getInteger('days') || 7;

    // Ensure the user has permission to ban members
    if (!interaction.member.permissions.has('BAN_MEMBERS')) {
        return interaction.reply({ content: 'You do not have permission to use this command.', ephemeral: true });
    }

    try {
        await interaction.guild.bans.create(user.id, days);
        await interaction.reply({ content: `User ${user} has been banned for ${days} day(s) due to: ${reason}`, ephemeral: true });
    } catch (error) {
        console.error(error);
        await interaction.reply({ content: 'An error occurred while banning the user.', ephemeral: true });
    }
}

// Register the command with the REST API
const commands = [banCommand];
const rest = new REST({ version: '9' }).setToken(TOKEN);

(async () => {
    try {
        console.log('Started refreshing application (/) commands.');

        await rest.put(
            Routes.applicationCommands(GUILD_ID),
            { body: commands },
        );

        console.log('Successfully reloaded application (/) commands.');
    } catch (error) {
        console.error(error);
    }
})();

// Listen for the 'ready' event and register the command
client.on('ready', () => {
    console.log(`Logged in as ${client.user.tag}!`);
});

// Listen for interactions and execute the ban command
client.on('interactionCreate', async (interaction) => {
    if (!interaction.isChatInputCommand()) return;

    if (interaction.commandName === 'ban') {
        await handleBanCommand(interaction);
    }
});

// Login to Discord with your bot's token
client.login(TOKEN);
