```cpp
#include <iostream>
#include <string>
#include <sstream>

// Function to convert Markdown to HTML
std::string markdownToHtml(const std::string& markdown) {
    std::stringstream ss;

    // Simple conversion rules
    std::string::const_iterator it = markdown.begin();
    while (it != markdown.end()) {
        if (*it == '#') {
            int level = 1;
            while (++it != markdown.end() && *it == '#') ++level;
            ss << "<h" << level << ">";
            while (it != markdown.end() && *it != '\n') {
                ss << *it++;
            }
            ss << "</h" << level << ">";
            continue;
        } else if (*it == '*') {
            if (it + 1 != markdown.end() && *(it + 1) == '*') {
                // Bold: **text**
                ss << "<strong>";
                it += 2; // Skip next two characters
                while (it != markdown.end() && *it != '*' || it + 1 != markdown.end() && *(it + 1) != '*') {
                    ss << *it++;
                }
                ss << "</strong>";
                continue;
            } else {
                // Italic: *text*
                ss << "<em>";
                while (it != markdown.end() && *it != '*' || it + 1 != markdown.end() && *(it + 1) != '*') {
                    ss << *it++;
                }
                ss << "</em>";
                continue;
            }
        } else if (*it == '`') {
            // Code: `code`
            ss << "<code>";
            it++; // Skip first backtick
            while (it != markdown.end() && *it != '`') {
                ss << *it++;
            }
            ss << "</code>";
            continue;
        }

        ss << *it++;
    }

    return ss.str();
}

int main() {
    std::string markdown = "# Header\n*Italic* **Bold** `Code`";
    std::string html = markdownToHtml(markdown);
    std::cout << html << std::endl;

    return 0;
}
```

### Explanation:
1. **Function Definition**: The function `markdownToHtml` takes a const reference to a `std::string` and returns a `std::string`.
2. **Markdown to HTML Conversion**:
   - **Headers**: Converts `#` followed by text into `<h1>`, `##` into `<h2>`, etc.
   - **Bold**: Converts `**text**` into `<strong>text</strong>`.
   - **Italic**: Converts `*text*` into `<em>text</em>`.
   - **Code**: Converts `` `code` `` into `<code>code</code>`.
3. **Main Function**: Demonstrates how to use the `markdownToHtml` function with a sample Markdown string.

