Certainly! To represent a chessboard using FEN (Forsyth-Edwards Notation) in LaTeX, we can use the `tikz` package, which is very powerful for drawing diagrams and illustrations. Here’s a step-by-step guide on how to achieve this:

1. **Install TikZ Package**: Ensure that you have the `tikz` package installed, as it is essential for creating the chessboard.

2. **Write the LaTeX Code**: Below is an example LaTeX code that draws a chessboard based on a given FEN string. For simplicity, let's assume the FEN string is provided as a command argument.

Here's a complete LaTeX document:

```latex
\documentclass{article}
\usepackage{tikz}

% Define a command to parse and draw the chessboard from FEN
\newcommand{\drawchessboard}[1]{%
    \begin{tikzpicture}
        % Loop through each character in the FEN string
        \edef\fen{#1}%
        \foreach \x in {0,...,7} {%
            \foreach \y in {0,...,7} {%
                \pgfmathtruncatemacro\piece{\fen[\x*8+\y]}%
                \ifnum\piece=0
                    % Empty square
                    \fill[black] (\x,\y) rectangle +(\x+1,\y+1);
                    \fill[white] (\x+0.5,\y+0.5) circle (0.25);
                \else
                    % Draw the piece
                    \ifnum\piece=1 % Pawn
                        \node at (\x+0.5,\y+0.5) [anchor=center] {\tiny p};
                    \fi
                    \ifnum\piece=2 % Knight
                        \node at (\x+0.5,\y+0.5) [anchor=center] {\tiny n};
                    \fi
                    \ifnum\piece=3 % Bishop
                        \node at (\x+0.5,\y+0.5) [anchor=center] {\tiny b};
                    \fi
                    \ifnum\piece=4 % Rook
                        \node at (\x+0.5,\y+0.5) [anchor=center] {\tiny r};
                    \fi
                    \ifnum\piece=5 % Queen
                        \node at (\x+0.5,\y+0.5) [anchor=center] {\tiny q};
                    \fi
                    \ifnum\piece=6 % King
                        \node at (\x+0.5,\y+0.5) [anchor=center] {\tiny k};
                    \fi
                \fi
            }
        }
    \end{tikzpicture}
}

\begin{document}

% Example FEN: "rnbqkbnr/pppppppp/8/8/8/8/PPPPPPPP/RNBQKBNR w KQkq - 0 1"
\drawchessboard{rnbqkbnr/pppppppp/8/8/8/8/PPPPPPPP/RNBQKBNR}

\end{document}
```

### Explanation:
